import Tiger from '../images/resized/Tiger.jpg';
import Cow from '../images/resized/Cow.jpg';
import Elephant from '../images/resized/Elephant.jpg';
import Goat from '../images/resized/Goat.jpg';
import Panda from '../images/resized/Panda.jpg';

const GetImagePath = (index) => {
    var images = [
        Tiger,
        Cow,
        Elephant,
        Goat,
        Panda,
    ];
    return images[index];
}
export default GetImagePath;
